import React, { Component } from 'react';

const navBar = <nav className="navbar fixed-top navbar-expand-md">
    <div id="skip">
        <a href="#overview">Skip to Content</a>
    </div>
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
        aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"><i className="fas fa-bars hamburger"></i></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav mx-auto nav">
            <li className="nav-item active"><a className="nav-link" href="index.html"><i
                className="fa fa-fw fa-home">&nbsp;Home</i></a></li>
            <li className="nav-item"><a className="nav-link" href="cases.html"><i
                className="fas fa-syringe">&nbsp;Cases</i></a></li>
            <li className="nav-item"><a className="nav-link" href="map.html"><i
                className="fas fa-map-marked-alt">&nbsp;Map</i></a></li>
            <li className="nav-item"><a className="nav-link" href="#symptoms"><i
                className="fas fa-hand-holding-medical">&nbsp;Care</i></a></li>
            <li className="nav-item"><a className="nav-link" href="survey.html"><i
                className="fas fa-poll">&nbsp;Survey</i></a></li>
            <li className="nav-item"><a className="nav-link" href="about.html"><i
                className="fas fa-ellipsis-h">&nbsp;About</i></a></li>
        </ul>
    </div>
</nav>;

export class HtmlHead extends Component {
    render() {
        let title = this.props.title;
        return (
            <head>
                <meta charset="utf-8" />
                <link rel="icon" href="%PUBLIC_URL%/favicon.ico" />
                <meta name="viewport" content="width=device-width, initial-scale=1" />
                <meta name="author" content="Spencer Nielsen, Samuel Hernadez, Hayden Tinker, Samuel Nguyen" />
                <meta name="description" content="Informing you about the coronavirus pandemic." />
                <meta name="keyword" content="coronavirus, virus, pandemic, 2020, COVID-19" />
                <link rel="apple-touch-icon" href="%PUBLIC_URL%/apple-touch-icon.png" />
                <link rel="apple-touch-icon" sizes="180x180" href="%PUBLIC_URL%/apple-touch-icon.png" />
                <link rel="icon" type="image/png" sizes="32x32" href="%PUBLIC_URL%/favicon-32x32.png" />
                <link rel="icon" type="image/png" sizes="16x16" href="%PUBLIC_URL%/favicon-16x16.png" />
                <title>{title}</title>
            </head>
        );
    }
}

export class HtmlBody extends Component {
    render() {
        return (
            <header>
                {navBar}
            </header>
        );
    }
}

export class HtmlFooter extends Component {
    render() {
        let citations = this.props.citations;
        return (
            <footer>
                <p>Contact <a href="mailto:amazingspencer13@gmail.com">Spencer</a>.
                Spencer Nielsen &copy; All rights reserved.</p>
                <p>{citations}</p>
            </footer>
        );
    }
}
